import styled from "styled-components"
import CicleProgress from "./CicleProgress"


const Container = styled.div`
    font-family: WantedSans-Regular;
    margin-top : 40px;
    font-size : 16px;
    padding : 5px;
    background-color :red;
`

function Position(){

    return(
        <Container>
            <CicleProgress />
        </Container>
    )
}

export default Position
